Martian Adventures (BBC)

Science Documentary hosted by Patrick Moore, published by BBC broadcasted as part of BBC The Sky at Night series in 2007 - English narration


Information
------------------------------

Patrick Moore celebrates the tremendous success of the Martian rovers Spirit and Opportunity and also the fleet of spacecraft now circling the red planet that are sending back astounding images in unprecedented detail.
Chris Lintott reports from NASA's Jet Propulsion Laboratory in California about the new mission Phoenix, which goes to the polar regions of Mars later this year and Lucie Green visits the Mars Yard in Aberystwyth, where Europe's rover ExoMars is being put through its paces.

